INSERT INTO frage (frage_id, frage_text) VALUES (16, "Welche Vorteile können RAID-Systeme haben?");
INSERT INTO antwort (antwort_id, antwort_text) VALUES (16, "1. Erhöhung der Ausfallsicherheit, 2. Steigerung der Datenübertragungsrate, 3. Aufbau logischer Laufwerke, 4. Austausch von Speichermedien, 5. Vergrößern des Speichers, 6. Kostenreduktion");
INSERT INTO karteikarte (thema, frage, antwort) VALUES (4, 16, 16);

INSERT INTO frage (frage_id, frage_text) VALUES (17, "Was ist RAID 0?");
INSERT INTO antwort (antwort_id, antwort_text, antwort_bild) VALUES (17, "RAID 0 beschleunigt den Datenzugriff, ohne Redundanzen zu erzeugen. Beim Striping werden Datenblöcke im Reißverschlußverfahren auf 2 Disks angeordet. Fällt eine der Festplatten aus, sind nicht nur ihre Daten verloren, sondern auch jene, die sich über beide Festplatten erstreckten.", 1);
INSERT INTO karteikarte (thema, frage, antwort) VALUES (4, 17, 17);

INSERT INTO frage (frage_id, frage_text) VALUES (18, "Was ist RAID 1?");
INSERT INTO antwort (antwort_id, antwort_text, antwort_bild) VALUES (18, "Alle Daten werden auf allen Festplatten gespeichert --> Raid 1 bietet volle Redundanz. Die kapazität ist nur so hoch wie der Speicherplatz der kleinsten Festplatte. Die Lesegeschwindigkeit ist bei 2 Platten verdoppelt.", 2);
INSERT INTO karteikarte (thema, frage, antwort) VALUES (4, 18, 18);

INSERT INTO frage (frage_id, frage_text) VALUES (19, "Was ist RAID 5?");
INSERT INTO antwort (antwort_id, antwort_text, antwort_bild) VALUES (19, "RAID 5 implementiert Striping mit Paritäten für jeden Block. D.h. A1 - A3 sind Nutzdaten und Ap deren Paritätsinformationen. Dies bietet sowohl gesteigerten Datendurchdsatz beim Lesen, Redundanz der Daten, als auch geringere Kosten.", 3);
INSERT INTO karteikarte (thema, frage, antwort) VALUES (4, 19, 19);

